window.bookSummaryJSON = "<p>To kill a common man, use a blade.&nbsp;</p> <p>To kill a soldier, use a bow.&nbsp;</p> <p>To kill a mage, use stronger magic.&nbsp;</p> <p>To kill a fallen god? Well... I better figure out what to use soon.&nbsp;</p> <p>I’m a murderer, a hired killer, an assassin with unheard of magic. I never asked to be a hero, but if I don’t stop this titan from destroying the kingdom, he will kill me, my family of assassins, and the two beautiful women that I love.&nbsp;</p> <p>So, it is a hero I will become.&nbsp;</p>"; 
